import "./App.css";
import MailConfirm from "./components/MailConfirm";
import MemberPage from "./components/MemberPage";
import SignIn from "./components/SignIn";
import SignUp from "./components/SignUp";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { motion } from "framer-motion";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <motion.div
            className="background_signin"
            initial={{ backgroundColor: ["#33ff55"] }}
            animate={{ backgroundColor: ["#33ff55", "#efaf1a", "#4d72f1"] }}
            transition={{
              duration: 20,
              ease: "linear",
              repeat: Infinity,
              repeatType: "reverse",
            }}
          >
            <Route exact path="/" element={<SignIn />} />
            <Route exact path="/signup" element={<SignUp />} />
            <Route exact path="/mailconfirm" element={<MailConfirm />} />
          </motion.div>
          <Route exact path="/memberpage" element={<MemberPage />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
